import React from "react";
import styled from "styled-components";

const ItemContainer = styled.div`
    display: flex;
    flex-wrap: wrap;
`;

const item = props => {
    return (
      <div className="item">
        <p onClick={props.click}>
          I am {props.name} and I am {props.price}!
        </p>
      </div>
    );
  };

  export default item;
